import './Navbar.css';

const Navbar = () => {
    return (
        <header>
            <nav className="desktop-navbar">
                <ul class="navbar__items">
                  <li><a class="desktop-navbar__link" href="#">Inicio</a></li>
                  <li><a class="desktop-navbar__link" href="#">Productos</a></li>
                  <li><a class="desktop-navbar__link" href="#">Contacto</a></li>
                </ul>
            </nav>

            {/* modal navbar start */}
            <div class="modal-navbar__background">
                <nav class="modal-navbar">
                  <ul class="modal-navbar__items">
                    <li><a href="" class="modal-navbar__link">Inicio</a></li>
                    <li><a href="" class="modal-navbar__link">Productos</a></li>
                    <li><a href="" class="modal-navbar__link">Contacto</a></li>
                  </ul>
                </nav>
            </div>
            {/* modal navbar end */}
        </header>
    )
}

export default Navbar;
